import React from "react";

import "bootstrap/dist/css/bootstrap.min.css";

import ApiList from "./components/apis-list";

function App() {
	return (
		<div>
			<nav className="navbar navbar-expand navbar-dark bg-dark">
				<a href="/" className="navbar-brand">
					Gimme APIs
				</a>
			</nav>
			<ApiList />
		</div>
	);
}

export default App;
